import React from 'react';
import './App.css';
import { Outlet } from 'react-router-dom';

function Home() {
  return (
    <div className="App">
      <Outlet />
      <h1>Welcome to Joel Hilton's Movie Collection</h1>
      <div>
        <img
          src="C:\Users\BYU Rental\Documents\IS413\JoelsFasterWebsite_olsenj8\frontend\public\joel.jpg"
          alt="Joel"
        ></img>
      </div>
    </div>
  );
}

export default Home;
